const styleLineaHor = {
  width: '90%',
  height: '0.1%',
  marginTop: '3.5%',
  marginLeft: '5%',
  backgroundColor: 'black',
};

export const LineaHor = () => {
  return (
    <div style={styleLineaHor}></div>
  )
}
